    "Text recognition for your images" : "Reconnaissance de texte pour vos images",
    "# Description\n\nNextcloud OCR (optical character recognition) processing for images with tesseract-js brings OCR capability to your Nextcloud.\nThe app uses tesseract-js in the browser in order to process images (png, jpeg, tiff, bmp) and saves the output PDF file to the source folder in nextcloud. That for example enables you to search in it.\n\n## Prerequisites, Requirements and Dependencies\nThe OCR app has some prerequisites:\n\n - [Nextcloud 16 and up](https://nextcloud.com/)\n\n - Only supported on latest modern web browsers (Chrome, Edge, Firefox, Opera, Safari*)\n\n - Tesseract traineddata needs about 200 MB space on your server (will be installed automatically).\n\n\n_* On Safari there is currently a problem with the [Content-Security-Policy](https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP), that requires an Administrator to set the 'script-src' to 'unsafe-eval' such that the app works properly. Because this is quite insecure the app itself does not set it and recommends to decide that on your own risk (please make sure, that you know what CSP is and what e.g. unsafe-eval causes)._\n\n## Installation\nInstall the app from the [Nextcloud App Store](https://apps.nextcloud.com/apps/ocr) or download the release package from github (**NOT** the sources) and place the content in **nextcloud/apps/ocr/**.\n\n## Disclaimer\nThe software is distributed on an \"AS IS\" BASIS, WITHOUT WARRANTIES OR\nCONDITIONS OF ANY KIND, either express or implied.\n\n## Note\nThe version 3 and earlier versions are not supported/maintained anymore by the author. So for asynchronous background processing please fork the repository and use the \"not-maintained\" branch to work on improvements. The author wasn't able to support it because of too much effort.\nMoreover this project is based on a webassembly port of tesseract. The maintainer stopped working on PDF processing in this app and will start working on separate app for pdf handling." : "# Description\n\nLe traitement des images par Nextcloud OCR fournit des fonctionnalités de reconnaissance optique de caractères à votre Nextcloud \nL'application utilise tesseract-js dans le navigateur pour traiter les images (PNG, JPEG, TIFF, BMP) et enregistre la sortie au format PDF dans le dossier source, dans Nextcloud. Ceci vous permet par exemple de rechercher dans le contenu ce dernier.\n\n## Prérequis\n\nL'application OCR présente les prérequis suivants :\n\n - [Nextcloud 16 et supérieur](https://nextcloud.com/)\n\n - Supportée uniquement avec les derniers navigateurs modernes (Chrome, Edge, Firefox, Opera, Safari*)\n\n - Les données d'entrainement de Tesseract nécessitent 200 Mo de stockage sur le serveur (installées automatiquement).\n\n_* Sur Safari, un problème est actuellement présent avec la [stratégie de sécurité du contenu (Content-Security-Policy)](https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP), qui nécessite que l'administrateur·trice affecte au paramètre 'script-src' la valeur 'unsafe-eval' pour que l'application fonctionne correctement. Étant assez peu sûr, l'application ne le fait pas elle-même et prévient que cette décision vous revient et se prend à vos risques et périls (veillez à vous assurer de savoir ce que sont la CSP ainsi que les effets de unsafe-eval)._\n\n## Installation\n\nInstallez l'application depuis l'[App Store Nextcloud](https://apps.nextcloud.com/apps/ocr), ou téléchargez le package de version depuis GitHub (**PAS** les sources) et placez son contenu dans le répertoire **nextcloud/apps/ocr/**.\n\n## Avertissement\n\nCe logiciel est distribué \"TEL QUEL\", SANS GARANTIES OU CONDITIONS DE QUELCONQUE NATURE, expresses ou implicites.\n\n## Note\n\nLes versions 3 et antérieures ne sont plus ni supportées ni maintenues par l'auteur. Ainsi, pour le traitement asynchrone en arrière-plan, bifurquez le dépôt et utilisez la branche \"not-maintained\" pour travailler à son amélioration. L'auteur n'était pas en mesure de supporter cette fonctionnalité car cela demandait un effort trop important.\nDe plus, ce projet est basé sur un portage webassembly de tesseract. Le développeur a cessé de travailler au traitement des PDFs dans cette application et travaillera à l'avenir sur une autre application pour le support des PDFs.",
